import React, {Component} from 'react'

class TodoList extends Component{
  render(){
    return(

      <div className="todolistMain">
        <form>
          <input type="text" placeholder="enter todo" />
          <button type="submit">Add Todo</button>
        </form>
      </div>
    )
  }
}

export default TodoList
